import React, { useState } from 'react'
import Questions from './Questions'
import './LauncherModal.css'
import Validation from './Validation'

const Launcher = () => {

  const [openModalForm, setOpenModalForm] = useState(false)
  const [openModalValidation, setopenModalValidation] = useState(false)

  const handleModalForm = () => {
    setOpenModalForm(true)
  }

  const handleModalValidation = () => {
    setopenModalValidation(true)
  }

  return (
    <div className='container__button-modal'>
        <button className='button-modal' onClick={handleModalForm}>Faire la simulation</button>
        {openModalForm && <Questions setOpenModalForm={setOpenModalForm}/>} 
        {openModalValidation && <Validation setOpenModalForm={setOpenModalForm}/>} 
    </div>
  )
}

export default Launcher
